import React, { useState } from "react";

function MomsCarForm( {onAddMomCar} ) {

    const [name, setName]= useState("")
    const [hp, setHP]= useState("")
    const [engine, setEngine]= useState("")
    const [topSpeed, setTopSpeed] = useState("")
    const [price, setPrice] = useState("")
    const [frontUrl, setFrontUrl]= useState("")
    const [backUrl, setBackUrl]= useState("")

    function handleSumbit (e) {
        e.preventDefault();

        fetch("http://localhost:3000/momcar", {
          method: "POST",
          headers: {
            "Content-Type": "application/json"
          }, 
          body: JSON.stringify({
            name: name,
            hp: hp,
            engine: engine,
            topSpeed: topSpeed,
            price: price,
            image: {
              front: frontUrl,
              back: backUrl,
            }
          })

        })
        .then((r) => r.json())
        .then((newCar) => onAddMomCar(newCar))
      }

    return (
        <div>
            <h3> Create a New Car !</h3>
            <input 
                placeholder="Name"
                name="name"
                value= {name}
                onChange= {(e) => setName(e.target.value)}
                >
            </input>
            <input 
                placeholder="Horse Power"
                name="hp"
                value= {hp}
                onChange= {(e) => setHP(e.target.value)}
                >
            </input>
            <input 
                placeholder="Engine"
                name="engine"
                value= {engine}
                onChange= {(e) => setEngine(e.target.value)}
                >
            </input>
            <input 
                placeholder="Top Speed"
                name="topSpeed"
                value= {topSpeed}
                onChange= {(e) => setTopSpeed(e.target.value)}
                >
            </input>
            <input 
                placeholder="Price"
                name="price"
                value= {price}
                onChange= {(e) => setName(e.target.value)}
                >
            </input>
            <input 
                placeholder="Front Image"
                name="name"
                value= {name}
                onChange= {(e) => setName(e.target.value)}
                >
            </input>
            <input 
                placeholder="Back Image"
                name="name"
                value= {name}
                onChange= {(e) => setName(e.target.value)}
                >
            </input>
        </div>
    )
}

export default MomsCarForm;
